    TEST_ASSERT_(mmapResult.IsSuccess(), "%s", mmapResult.GetStatusDescription());

    // Initial state

    WriteRegisterWord(RegisterType::PC, 0xCB16);
    WriteRegisterWord(RegisterType::SP, 0x80E2);
